INSERT INTO `social_stream_fb_post` VALUES (169,'Are you brave enough to #LiveLifeAmplified with Maybank 2 Cards? Join our challenge for a chance to win RM10,000 to fulfill your wildest dream! Get started now! http://maybk.co/M2CAmp','168151513217686','',0,1123,8,14,'2013-11-18 03:19:57',1,1),(170,'#mbbtechtalk This is a great new innovation! #Maybank card holders here is a question for you: would you use this?\n\nAssume that the device is EMV (chip) compliant + has added security features like a finger-print scanner.','168151513217686','',0,54,8,0,'2013-11-18 02:25:36',1,1),(171,'Congratulations to the winners of the #Maybank 1 Million Fans iPad mini giveaway contest.\n\nClick http://maybk.co/f368df to view the winners.\n\nThank you to all who participated!','168151513217686','',0,323,100,18,'2013-11-18 02:20:06',1,1),(172,'Realisasikan impian bercuti di Amerika Syarikat dan bertemu dengan artis kesayangan anda.\n\nHanya berbelanja RM100 dengan Kad Debit #Maybank atau langgan mana-mana produk Maybank One Solution untuk peluang menang anda. Kempen tamat 31 Jan 2014.\n\nLayari http://maybk.co/3069cf untuk keterangan lanjut, terma dan syarat.','168151513217686','',0,1107,37,3,'2013-11-18 01:46:19',1,1),(173,'We have received our solar-powered light bulbs, flown in from Denver, we are testing them out by letting them sit in the sun. What would you do if you had no light at night? #Maybank #projectheart \n\nHelp to make a difference visit www.maybankprojectheart.com','168151513217686','',0,6305,88,63,'2013-11-18 01:15:07',1,1),(174,'Have you voted for #Maybank2u as your Favourite Online Bank? :) We\'re looking for your support in the #NEF-Awani ICT Awards 2013!\n\nClick here to find out more and to cast your votes: http://www.nefawani.com/v_2010/awards/vote-now/favourite-online-banking','168151513217686','',0,1271,17,22,'2013-11-18 00:59:43',1,1),(175,'Ever dream of attending one of the biggest concerts in the world? You can now with Maybank 2 Cards.\r\n\r\nJoin our #LiveLifeAmplified challenge today for a chance to win RM10,000 to fulfill your wildest dream! http://maybk.co/M2CAmp','168151513217686','',0,2320,4,16,'2013-11-17 15:00:48',1,1),(176,'300 #FREE tickets to be won exclusively for #Maybank Debit and Credit cardmembers in a special campaign \"A badminton experience money can\'t buy\" in conjunction with the Maybank Malaysia Open Superseries Premier 2014 to be held from 14th to 19th Jan 2014.\n\nThe tickets offer exclusive court side seating areas and once-in-a-lifetime experience for diehard badminton fans. Campaign starts now to 30th November 2013.\n\nHurry up! Click http://maybk.co/a2bb13 for more details. T&Cs apply. #MMO2014','168151513217686','',0,6262,33,63,'2013-11-17 11:10:40',1,1),(177,'Calling all #Maybank Credit Cardmembers! Stand a chance to win these gadgets when you recommend your friends with our Maybank-Maxis Recommend & Win Contest: http://maybk.co/362a43\n\nContest ends 30 Nov 2013. T&C apply.\n\nNot a Maybank Cardmember? Sign up for any Maybank Credit Card to get the Smartest Deal in town here: http://maybk.co/1db399','168151513217686','',0,1617,6,11,'2013-11-17 04:12:25',1,1),(178,'Maybank Donates RM 1 Million to Typhoon Haiyan Victims in the Philippines\n\nMaybank, has contributed RM1,000,000 to the Philippine Red Cross in aid of relief efforts for the victims of Super Typhoon Haiyan. The Group operates in the Philippines via its subsidiary Maybank Philippines Inc. which has 69 branches.\n\nHaiyan, which is one of the strongest tropical cyclones ever recorded, has wrought severe destruction to Central Philippines, particularly on Samar Island and Leyte province. The donation will specifically be used to provide additional medicine, food and potable water supply in Tacloban City, which is reportedly most devastated and currently the focus of Red Cross’ relief efforts. \n\nMaybank Chairman Tan Sri Megat Zaharuddin said that the bank was deeply saddened by the suffering of the people of the Philippines as well as the devastation of property and livelihood. “Our sympathies and prayers are with the Government and people of the Philippines, as they go through the grief arising from this natural disaster. We hope that our contribution will bring urgent relief to those who require it most and help them rebuild their lives.\"\n\nRead more here http://maybk.co/9c09de','168151513217686','',0,599,52,72,'2013-11-16 12:43:12',1,1),(179,'Maybank Bercham had relocated to a new premise and is now operating at this new address. The branch will be taking up the new branch transformation look & feel.\n\nAddress:\n166, 168 & 170, Jalan Tasek Timur,\nPusat Perdagangan Tasek Indra,\n31400 Ipoh.\n\nPlease call 05-545 4188 / 05- 545 4288 for any enquiries.','168151513217686','',0,300,8,13,'2013-11-15 23:33:00',1,1),(180,'It\'s so easy to settle all your #PDRM summons at any #Maybank ATM. You can check and pay your own and even third party #summons with no service charge or pre-registration required.','168151513217686','',0,375,3,35,'2013-11-14 09:01:59',1,1),(181,'#mbbpsa Have you updated your browser? Update your browser to enjoy better security, faster speed, improved compatibility and experience.\n\nPlease check your browser here http://maybk.co/c4a568 for safer Internet banking.\n\nFor more safety tips, please read here: http://maybk.co/cf571f','168151513217686','',0,109,9,0,'2013-11-14 05:08:56',1,1),(182,'Let there be light! The solar powered light bulbs are in good working condition! Can’t wait to send them out to the folks in Kampung Chuweh. Do your bit to light up a community and please visit www.maybankprojectheart.com #maybank #projectheart','168151513217686','',0,85,3,2,'2013-11-13 08:46:59',1,1),(183,'Congratulations to the winners of the #Maybank GO Ahead. Vote & Win contest.\n\nClick http://maybk.co/fd166e to view the winners.\n\nTo all winners, we will be in touch with you soon! And thank you to all who participated and stay tuned for the Grand Finals videos, coming soon!','168151513217686','',0,157,3,4,'2013-11-13 06:52:41',1,1),(184,'GO AHEAD. WIN: Walk-In Interview for Telesales Executive\n\nVirtual Banking in Maybank is currently looking for dynamic and high self-motivated individuals to be part of the team Spread the news! Keep your friends informed of this opportunity. This is the best chance for you and your friends to work with a reputable organization, #MAYBANK!\n\nDate: 11 - 15 November 2013 (Monday - Friday)\nTime: 9:00 AM – 3:00 PM\nVenue: Maybank Group Customer Care (MGCC), Lot 12, Jalan Astaka, U8/84, Section U8, Bukit Jelutong, 40150 Shah Alam, Selangor.\n\nClick http://maybk.co/58449d to find out the requirements.','168151513217686','',0,135,6,6,'2013-11-13 06:52:32',1,1),(185,'Now you can let your child\'s dream come true with Manchester United Soccer School Player Development Courses. Register today with your #Maybank Manchester United Card and enjoy 20% savings!\n\nOpen to boys and girls from age 7 - 16 years old. Limited to 96 students only. For more details, click here: http://maybk.co/b637c7 #MUSS','168151513217686','',0,117,5,1,'2013-11-12 17:47:12',1,1),(186,'Solve this riddle:\n\"It\'s not a precious stone, but it\'s as clear as crystal. \nIf you keep it, it\'ll disappear, so don\'t be sentimental.\"','168151513217686','',0,273,79,1,'2013-11-12 17:10:42',1,1),(187,'Congratulations to all the Facebook winners of the #Maybank Watch & Win a stay in Langkawi contest.\n\nClick http://maybk.co/77f024 to view the winners.\n\nThank you to all for your participation!','168151513217686','',0,176,10,0,'2013-11-12 15:55:14',1,1),(188,'Maybank collaborated with the Malaysian Conservation Alliance for Tigers (MYCAT) to organise the Maybank Wild Tiger Run on 9 November 2013. The Run was held at Bukit Jalil Park and its objective was threefold: to increase public awareness of the plight of the Malayan tiger, to raise funds for wildlife conservation efforts and to celebrate MYCAT’s 10 years of tiger conservation partnership.\n\nThe run\'s 10km competitive race and 3km \'Fun Run\' was flagged off by Malaysian Youth and Sports Minister, YB Khairy Jamaluddin. Also in attendance were Pn Nora, Head of Maybank Group Human Capital and Pn Eliza Mohamed, Head of Maybank Corporate Affairs cum Head of Maybank Foundation Secretariat.\n\nOther activities held at the event included T-shirt printing by Orkibal, tiger graffiti demonstration by graffiti artists Media and Anok Ayer, and airbrush body painting by Paul. This was the result of a special collaboration with the National Visual Arts Gallery where the talent of young artists was harnessed for the Malayan tiger. Funds raised were donated to MYCAT.','168151513217686','',0,113,1,3,'2013-11-12 01:55:12',1,1),(189,'We will be at the Kuala Lumpur International Motor Show 2013 from 15 – 24 November 2013! There are loads of activities and great prizes up for grabs when you sign up for any #Maybank product or services. See you there!\n\nClick here http://maybk.co/d5fe68 for more information. #KLIMS13','168151513217686','',0,228,5,13,'2013-11-11 19:44:59',1,1),(190,'Have you participated in our Facebook #MBB5ave Timeline Hunt? \n\nHere\'s the clue for Code 5! Enter your answers for all the codes your have found here: http://maybk.co/434e6e\n\nSolve Code 5 by finding out what this recipe makes:\n• 1 cup concentrated rosewater\n• 3 cups sugar\n• 1 cup fresh rose petals (non-sprayed)\n• A few drops red food colouring (optional)\n\nThis recipe makes _ _ _ _ _ (5 characters).','168151513217686','',0,159,19,2,'2013-11-11 16:22:03',1,1),(191,'Do you like the new #Samsung Galaxy Note 3?\r\n\r\nReload a min RM30 or more via #Maybank ATM, Maybank2u or Maybank2u Mobile for your #CelcomXpax and the Top 5 with the highest reload value for the month will stand a chance to win!\r\n\r\nReload now! Campaign start from now till 31 Jan 2014. T&Cs apply. More details here: http://maybk.co/7e723f','168151513217686','',0,149,4,1,'2013-11-11 04:40:25',1,1),(192,'Thank you for all who voted and chose us as your preferred choice of employer for the 3rd time running.\n\nIn this annual event organised by GTI Media Asia, it\'s an honour that Maybank in the hearts and minds of graduates in Malaysia. We have improved in the overall ranking of employers, moving up to No. 2 spot from No. 3 in 2012 and No. 5 in 2011. We are also proud to note that our Global Maybank Apprentice Programme (GMAP) was voted as one of the best graduate programs for Banking and Financial Services industry and Maybank Go Ahead. Challenge as one of the top 3 Finalists for Best Innovation on Campus. \n\nMaybank Group Chief Human Capital Officer, Pn Nora Abd Manaf, together with the support of Group Human Capital team collected the Awards on behalf of Maybank. On behalf of Maybank, we share such an honour with all those who have been on this journey with us - our customers, partners and stakeholders. Thank you! \n\nCheck out the full list of winners here http://malaysias100.com/awards/ranking/2013-rankings','168151513217686','',0,97,2,0,'2013-11-11 02:27:25',1,1),(193,'Attention to all #Maybank Manchester United Credit and Debit cardmembers, now is your chance to win an all-expense paid tickets for 2 to watch #MU battle LIVE at Old Trafford!\n\nClick here http://maybk.co/a29403 for more details. T&Cs apply.','168151513217686','',0,118,2,5,'2013-11-09 10:29:21',1,1),(194,'Enjoy returns of up to 3.50% p.a. with FD/IFD-i Countdown 3 #FixedDeposit Campaign. Hurry as the campaign start now till 15 November 2013.\n\nClick here http://maybk.co/6c150a for more details. T&Cs apply. #Maybank','168151513217686','',0,185,5,4,'2013-11-09 10:17:54',1,1),(195,'Good morning Malaysia! Start your day with a good breakfast. We\'re giving away free breakfast the next few days at selected #Maybank branches inconjunction with our Deposit Campaign #MBB5ave.','168151513217686','',0,551,26,21,'2013-11-08 15:37:32',1,1),(196,'Come over to #Maybank Shah Alam Main branch tomorrow (8 November, Friday) for your free breakfast! \n\nWith just the price of your daily breakfast, saving RM5 daily could win you RM50,000! #MBB5ave today: http://maybk.co/23ef29','168151513217686','',0,154,7,1,'2013-11-08 03:42:12',1,1),(197,'Invest in London properties right here in Malaysia with #Maybank Foreign Currency Offshore Property Financing-i. Your mortgage will be processed locally in Sterling Pound with stamp duty exemption.\n\nClick here http://maybk.co/c20666 for more details.','168151513217686','',0,146,1,0,'2013-11-06 13:57:45',1,1),(198,'It\'s the last day of submissions for the Maybank #Photography Awards 2013! US$35,000 up for grabs! http://www.maybankphotoawards.com/ #MPA2013','168151513217686','',0,173,15,2,'2013-11-06 10:20:04',1,1),(199,'Handing over of Banking License from the Deputy Governor of the National Bank of Cambodia,  Lok Chumteav OukMaly to CEO International (Maybank), Pollie Sim','168151513217686','',0,12,0,0,'2013-11-06 07:57:19',1,1),(200,'Can you solve Code 3? #MBB5ave \nContest details here:http://maybk.co/434e6e\n\nEnjoy additional returns of up to 3.85% when you open or top-up your deposit account with #Maybank or Maybank Islamic. Click http://maybk.co/9ec72afor more details. T&C apply. #MBB5ave','168151513217686','',0,12,29,0,'2013-11-05 08:35:09',1,1),(202,'TAC number cuma dapat bila account dah log out. apa kejadah semua ni?? bukan hari ni je, dah dekat sebulan.\n\nsaya guna maxis prepaid+maybank saving account..\n\nmohon maybank bangkrap... sekian.','1051646510','',0,0,2,0,'2013-11-18 03:41:05',1,1),(203,'Sikit lagi berjanggut tunggu TAC yang tak kunjung tiba.','731356246','',0,0,4,0,'2013-11-18 03:40:25',1,1),(204,'Pembelian tambah nilai bagi telpon mudah aleh amat baik dan terima kaseh kpd Maybank memberi kemudahan tersebut ......Tambah nilai bagi TalkBIZ bagi semua ahli TalkBIZ dan yang lain2....... Masuk lah Ahli TalkBIZ... Kalau nak tahu Log Web ini      www.TalkTalkBIZ.com/mnbiz1952\nwww.TalkTalkBIZ.com?mnbiz1952\n\nGunalah akaun MayBank